import React from "react";
import "./App.css";
import First from "./components/basics/First";
import WithParameter from "./components/basics/WithParameter";
import WithChildren from "./components/basics/WithChildren";
import Card from "./components/layout/Card";
import Repeat from "./components/basics/Repeat";
import Conditional from "./components/basics/Conditional";
import ConditionalWithIf from "./components/basics/ConditionalWithIf.jsx";

export default (props) => (
  <div className="App">
       <Card titulo="#06 - Condicional v2" color="#FA6900">
      <ConditionalWithIf numero={10}>

      </ConditionalWithIf>
    </Card>
    <Card titulo="#05 - Condicional v1" color="#E94C6F ">
      <Conditional numero={11}>

      </Conditional>
    </Card>
    <Card titulo="#04 - Repeticão" color="#A7DBDB">
      <Repeat />
    </Card>
    <Card titulo="#03 - Componente com Filhos"> color="#DB3340"
      <WithChildren>
        <ul>
          <li>Ana</li>s<li>Bia</li>
          <li>Carlos</li>
          <li>Daniel</li>
        </ul>
      </WithChildren>
    </Card>
    <Card titulo="#02 - Componente com Parametro">
      <WithParameter titulo="esse é o titulo" subtitulo="esse é o subtitulo" />
    </Card>
    <Card titulo="#01 - Primeiro Componente">
      <First />
    </Card>
  </div>
);
